import React,{Component} from "react";
import  '../assets/css/base.css'
import '../assets/css/style.css'
import querystring from 'query-string'
import {Link} from 'react-router-dom'
import $ from 'jquery'

import axios from 'axios';

class Proservice extends Component {
  render() {
    return (
        <div class="wrap">
	    <div class="top_fixed">
	    	<a href="javascript:window.history.back()" class="left_btn"><i>&#xe622;</i></a>
	    	<h1>单页模板</h1>
	    	<a href="javascript:;" class="right_btn hide">预约</a>
	    </div>



	    <div class="container">
			 <div class="art">
				<p class="empty"><img src="img/empty.png"/></p>
			  </div>
	    </div>

</div>
    )
    }
}
export default Proservice;
